INSERT INTO `all_products` (`plant_id`, `plant_name`, `plant_img`, `plant_price`, `plant_desc`) VALUES
(45, 'Calathea medallion plant', 'calathea-medallion-plant-white-pot.jpg', 150, 'Calathea plants are imitation plants designed to replicate the \r\nappearance of real Calathea species, known for their vibrant and patterned \r\nfoliage.'),
(48, 'Monstera Deliciosa Plant', 'monstera-deliciosa-plant-pot (1).jpg', 135, 'Monstera deliciosa, often called the \"Swiss cheese plant,\" is a popular \r\ntropical houseplant known for its distinctive, split, and hole-ridden leaves. \r\n'),
(49, 'Ficus Lyrata Plant', 'ruffled-leaf-palm-gray-pot.jpg', 150, 'Ficus lyrata, commonly known as the fiddle leaf fig, is a popular tropical houseplant \r\nprized for its large, violin-shaped leaves. Native to Western Africa, it can grow up to \r\n6 feet or more indoors. Ficus lyrata requires bright, indirect light and well-draining \r\nsoil to thrive. Proper care involves regular watering, but allowing the soil to dry \r\nslightly between waterings.'),
(50, 'Philodendron Birki plant', 'peace-lily-plant-terracotta-pot-home-decor-object.jpg', 200, 'Philodendron Birkin is a striking houseplant with dark green leaves adorned \r\nwith creamy-white to silvery variegation. It thrives in bright, indirect light and \r\nrequires consistent but not excessive watering. This compact, upright plant is a \r\npopular choice for adding a touch of elegance to interior decor. However, it \r\nshould be kept away from direct sunlight and is toxic if ingested by pets or \r\nhumans'),
(51, 'Zamia Plant', 'zz-plant-gray-pot.jpg', 200, 'Zamia is a genus of cycad plants with palm-like appearances, \r\nknown as \"coontie\" or \"sago palm.\" They are native to tropical \r\nand subtropical regions worldwide, valued for their prehistoric \r\nlook. Some species contain toxic compounds, necessitating \r\nproper handling. Zamia is cultivated for ornamental use and is a \r\nsymbol of ancient plant life, often called \"living fossils\".'),
(52, 'Watermelon Peperomia ', 'faux-watermelon-peperomia-plant-gray-pot.jpg', 160, 'Peperomia argyreia, the watermelon peperomia, is a species of flowering plant in the family Piperaceae, native to northern South America, including Bolivia, Brazil, Ecuador, and Venezuela. The plant is not closely related to either watermelons or begonias. These terms relate to the shape, markings and texture of the leaves. Growing to 20 cm (7.9 in) tall and broad, it is a perennial with asymmetrical oval green leaves, slightly fleshy, strikingly marked with curved silver stripes, and red stems.'),
(53, 'fiddle-leaf fig plant', 'fiddle-leaf-fig-plant-pot.jpg', 140, 'fiddle leaf figs can grow a couple feet every year if given the proper care. These popular houseplants can climb up to 6 feet or more in your home. Their green and shiny leaves, coupled with their unique shape make this plant your go-to choice for entertaining areas. Most fiddle leaf fig trees serve as floor plants thanks to their towering size. Younger fiddle leaf figs can temporarily live on shelves while theyâ€™re small. The F. lyrata compacta and suncoast cultivars are smaller and bushier vari'),
(54, 'Pepper face plant', 'pepper-face-plant-small-pot.jpg', 120, 'Pepper Face is a tropical evergreen herbaceous shrub that is erect and bushy and grows up to 2  tall. The glossy cupped, obovate leaves on branched, distinct stems and petioles that are usually tinged pink are key ID features. Leaf attachment is a sub-peltate. This plant is commonly used as an interior specimen or desktop plant. This plant tolerates low light for several months without stress, especially non-variegated cultivars. It is intolerant of wet soil, very dry soil, or very drafty sites.'),
(55, 'Cashew Plant', 'HE_Cashew-1-01.jpeg', 80, 'Dwarf hibiscus (Hibiscus rosa-sinensis) is a compact variety \r\nof the popular hibiscus plant, typically reaching 2-4 feet in \r\nheight. It features vibrant, large, and colorful flowers that \r\ncome in various shades. Dwarf hibiscus is well-suited for \r\nsmaller gardens, pots, or as an indoor plant. It requires full \r\nsun and well-drained soil for optimal growth and blooms.'),
(56, 'Custard apple Plant', 'custard-apple-tree-500x500.jpg', 60, 'Custard Apple Plant  is a tropical climbing plant native to India, \r\nknown for producing black pepper. It features heart-shaped \r\nleaves and green berries that turn dark when dried for black \r\npepper production. This spice is famed for its pungent, spicy \r\nflavor and is used in diverse cuisines globally. Its also \r\nassociated with potential health benefits like aiding digestion \r\nand acting as an antioxidant.'),
(57, 'Coconut Plant', 'GreenCoconut1.jpg', 100, 'Coconut Plant or Cocos nucifera, commonly known as the coconut palm, is a tropical plant native to coastal regions. Its recognized for its tall, slender trunk and large, feathery fronds. The coconut tree produces versatile fruits known as coconuts, which contain water, edible flesh, and oil. These \r\ncoconuts are used in various culinary, industrial, and cosmetic applications worldwide.Coconut plants grow well in coastal regions and tropical areas of India. '),
(58, 'Mango Plant', 'Mango.jpeg', 120, 'The mango tree, is a tropical fruit-bearing plant known for its delicious and juicy mango fruits. It features evergreen leaves and grows up to 100 feet in height. Mangoes, often referred to as the \"king of fruits,\" come in various varieties with different flavors and colors. They are widely cultivated for their sweet and tangy flesh, enjoyed in culinary dishes and beverages globally'),
(66, 'Lace aloe plant', 'product1.jpg', 100, 'Lace aloe plant is a group of small, low-growing succulent plants known for \r\ntheir rosette-like growth pattern. These hardy succulents are native to \r\nsouthern Africa and are popular as houseplants due to their compact size and \r\nunique appearance. They require bright but indirect sunlight and well draining soil, making them easy to care for.'),
(67, 'Calathea ornata plant', 'calathea-ornata-sanderiana-orange-flowerpot.jpg', 250, 'Calathea ornata plant is a stunning houseplant cherished for its elegant, dark \r\ngreen leaves adorned with pink or white stripes. It thrives in indirect light and \r\nrequires consistent moisture to maintain its vibrant appearance. This tropical \r\nplant is prized for its air-purifying qualities and is a popular choice for adding a \r\ntouch of sophistication to indoor spaces.'),
(68, 'Spathiphyllum wallisii', 'product3.jpg', 100, 'Spathiphyllum wallisii, commonly known as peace lily, white sails, or spathe flower, is a very popular indoor house plant of the family Araceae. The genus name means \"spathe-leaf\", and the specific epithet is named after Gustav Wallis, the German plant collector. It was first described in 1877.'),
(70, 'Calathea medallion plant', 'calathea-medallion-plant-white-pot.jpg', 200, 'Calathea plants are imitation plants designed to replicate the \r\nappearance of real Calathea species, known for their vibrant and patterned \r\nfoliage. '),
(75, 'Ficus Lyrata Plant', 'ruffled-leaf-palm-gray-pot.jpg', 149, 'Ficus lyrata, commonly known as the fiddle leaf fig, is a popular tropical houseplant \r\nprized for its large, violin-shaped leaves. Native to Western Africa.'),
(76, 'Philodendron Birki Plant', 'peace-lily-plant-terracotta-pot-home-decor-object.jpg', 200, 'Philodendron Birkin is a striking houseplant with dark green leaves adorned \r\nwith creamy-white to silvery variegation. It thrives in bright, indirect light and \r\nrequires consistent but not excessive watering. This compact, upright plant is a \r\npopular choice for adding a touch of elegance to interior decor. However, it \r\nshould be kept away from direct sunlight.'),
(78, 'Zamia Plant', 'zz-plant-gray-pot.jpg', 200, 'Zamia is a genus of cycad plants with palm-like appearances, \r\nknown as \"coontie\" or \"sago palm.\" They are native to tropical \r\nand subtropical regions worldwide, valued for their prehistoric \r\nlook. Some species contain toxic compounds, necessitating \r\nproper handling. Zamia is cultivated for ornamental use and is a \r\nsymbol of ancient plant life, often called \"living fossils\".'),
(82, 'Coconut Plant', 'GreenCoconut1.jpg', 100, 'Coconut Plant or Cocos nucifera, commonly known as the coconut palm, is a tropical \r\nplant native to coastal regions. Its recognized for its tall, slender trunk \r\nand large, feathery fronds. The coconut tree produces versatile fruits \r\nknown as coconuts, which contain water, edible flesh, and oil.'),
(84, 'Watermelon Peperomia', 'faux-watermelon-peperomia-plant-gray-pot.jpg', 160, 'Peperomia argyreia, the watermelon peperomia, is a species of flowering plant in the family Piperaceae, native to northern South America, including Bolivia, Brazil, Ecuador, and Venezuela. The plant is not closely related to either watermelons or begonias. These terms relate to the shape, markings and texture of the leaves. Growing to 20 cm (7.9 in) tall and broad, it is a perennial with asymmetrical oval green leaves, slightly fleshy, strikingly marked with curved silver stripes, and red stems.'),
