(68, 'product3.jpg', 'Spathiphyllum wallisii', '150', 100, 'Spathiphyllum wallisii, commonly known as peace lily, white sails, or spathe flower, is a very popular indoor house plant of the family Araceae. The genus name means \"spathe-leaf\", and the specific epithet is named after Gustav Wallis, the German plant collector. It was first described in 1877.');

