(84, 'faux-watermelon-peperomia-plant-gray-pot.jpg', 'Watermelon Peperomia', 160, 'Peperomia argyreia, the watermelon peperomia, is a species of flowering plant in the family Piperaceae, native to northern South America, including Bolivia, Brazil, Ecuador, and Venezuela. The plant is not closely related to either watermelons or begonias. These terms relate to the shape, markings and texture of the leaves. Growing to 20 cm (7.9 in) tall and broad, it is a perennial with asymmetrical oval green leaves, slightly fleshy, strikingly marked with curved silver stripes, and red stems.');

